Reverts linkedin/gobblin#1615

Reverting supporting of "encrypt.key.val" as state can be persisted.

@htran1 , could you take a look? Thanks.

@jinhyukchang 

- EncryptionConfigParser parser was picking up config settings it shouldn't care about

- Don't return a half-filled in config if mandatory parameters (like algorithm) aren't present

- Use `Set` of inputPaths instead of `List` because paths are meant to be unique and order of paths does not matter
- Use `CopyOnWriteArraySet` for inputPaths to prevent concurrent modifications

@htran1 can you review?
